import React from 'react'
import css from "../../styles/main.scss"

const BottomNav = () => {
  return (
    <nav className={`navbar fixed-bottom`}>
      <a className="navbar-brand" href="#">Fixed bottom</a>
    </nav>
  );
}

export default BottomNav;
